INSERT INTO `events` VALUES (1,'2023-01-01 17:32:36','2023-02-26 18:01:57','Wakiso persons with disabilities grand dinner Grand Dinner - 2023','Creating investigate opportunities through social synergies','images/dinner-4.jpg','<p class=\"ql-align-justify\">Islamic University in Uganda (IUIU) will prepare a homecoming dinner, inviting all alumni to buy tickets to contribute to their alma mater. The event will take place at the Islamic University in Uganda Females’ Campus (IUIUFC) from 2:00 pm-9:00 pm. <strong>The dinner is one of the events organized by the </strong>alumni association other events included environmental activities 25-27<sup>th</sup> November 2022. The sports gala and team building exercises will take place on 4<sup>th</sup> February 2023, Health Caravans will be on each major event, and Daawa activities on 6<sup>th</sup> February 2023.</p>','3rd IUIU Alumni Grand Dinner - 2022','146','18','13','IUIU Female\'s campus - Kaboja','images/iuiu-females-campus.jpg','images/iuiu-map.png','2023-02-10','Kabojja, Nateete, Kampala','0.292165','32.514309','files/intro.mp4');
