INSERT INTO `news_posts` VALUES (1,'2023-01-01 13:42:46','2023-02-26 18:06:36','Sustainable Cities & Communities','<p>The long serving rector of the Islamic University In Uganda (IUIU), Dr. Ahmed Kawesa Ssengendo, has ended his 33 years of service at the second oldest university in the country.</p><p>Ssengendo was recently appointed Assistant Secretary General at the Organisation of Islamic Cooperation in Jeddah Saudi Arabia.</p><p>While bidding farewell at the main campus in Mbale, Ssengendo pledged to use his new office to promote the the university.</p><p>Dr. Ssengendo is among the pioneer lecturers at IUIU. He left Makerere University to start IUIU from scratch in 1987.</p><p>He joined the university as a lecturer before rising through the ranks to become the rector, the university’s top job, a position he held for 16 years.</p><p>Earlier this year, Ssengendo was appointed the Assistant Secretary General of the Organisation of Islamic Cooperation.</p><p>Bidding farewell to the longest serving boss, his peers and old students described him as a man of unique character and strong leadership skills</p><p>Ssengendo challenged his successor, Dr. Ismail Simbwa Gyagenda to uphold the values that the university stands for such as integrity and solving community problems.</p><p>He leaves behind a master plan upon to guide the further development of IUIU .</p><p>Other achievements include; expanding the university’s academic menu, academic excellence and maintaining discipline among staff and students.</p><p>The university has not experienced any strike during his 16 years of leadership.</p><p>Dr Gyagenda pledged to preserve and further his predecessor’s legacy.</p><p>IUIU is Uganda’s second oldest university and the first to be established outside Kampala.</p><p>It is the only private university established by an Act of Parliament.</p>',1,3,0,'The long serving rector of the Islamic University In Uganda (IUIU), Dr. Ahmed Kawesa Ssengendo, has ended his 33 years of service at the second oldest university in the country.','images/ssengendo.jpg'),(2,'2023-01-01 13:54:25','2023-02-26 18:08:40','Chairman of ICT for persons with disabilities meets delegates from 8Tech','<p>The Chairman of the Islmic University In Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting the Rector and VC Rector Academic Affairs at the IUIU Kamapala campus.</p><p><img src=\"https://iuiuaa.org/wp-content/uploads/2021/02/iuiu_campus-2-1024x683.jpg\"></p><p>Mr. Abdul Noor Sekindi, the Chairman IUIUAA led a delegation of IUIU Alumni Interim Executive Committee to the IUIU Kampala campus where they met the Rector of IUIU, Prof Dr. Ismail Simbwa Gyagenda and Dr. Serwanga Jamilu, the Vice Rector Academic Affairs.</p>',1,2,0,'The Chairman of the Islmic University In Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting the Rector and VC Rector Academic Affairs at the IUIU Kamapala campus.','images/group-photo.jpg'),(3,'2023-01-01 13:58:35','2023-02-26 18:07:52','Chairman of ICT for persons with disabilities meets delegates from UCC','<p>The chairman (Mr. Abdulnur sekindi) of the Islamic University in Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting with Islamic University alumni medical students working in different health unities within the country among them are; Dr. Mpungu Amirah, Dr.Nakawesa Amina Ismail, Dr.Ssaka Mustafa and Dr.Nabukeera Aisha Masimbi</p><p>The chairman called upon the alumni medical students to organize themselves, and mobilize others alumni doctors working in different health facilitates within the country to come up with a unifying body that identifies all the alumni doctors of the Islamic university in Uganda.</p><p><img src=\"https://iuiuaa.org/wp-content/uploads/2021/05/WhatsApp-Image-2021-05-20-at-16.23.42.jpeg\"></p><p>He also appealed to the alumni medical students to show commitment to the association and this will create more opportunities, connections and social networking among the entire alumni body. On his other statement he promised to appoint two representatives of the alumni medical students to be on the interim committee and they will act as a bridge for the medical alumnus.</p><p>Mrs. Aisha Nambooze (Member IUUAA) committee emphasized on mobilization, commitment, social networking and encouraged the medical alumnus to be fully available for the activities of the association, she assigned the medical students a responsibility of mobilizing atheist 50 alumni’s by 20<sup>th</sup>\\JUNE\\2020.</p><p><img src=\"https://iuiuaa.org/wp-content/uploads/2021/05/WhatsApp-Image-2021-05-20-at-16.23.43.jpeg\"></p><p>Ms. Chebukwa Shukur, the current IUIU alumni administrator encouraged the medical alumnus to be competitive, outstanding and represent the entire body of the medical students of the Islamic university in Uganda and this would give good leadership to the current medical students of the Islamic university in Uganda.</p><p>The medical alumnus requested for support, mentorship and cooperation from the chairman and his entire team and also briefed the chairman about the challenges and competition they are facing with other medical alumnus from different institutions.</p>',1,2,0,'The chairman (Mr. Abdulnur sekindi) of the Islamic University in Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting with Islamic University alumni medical students working in different health unities within the country among them are; Dr. Mpungu Amirah, Dr.Nakawesa Amina Ismail, Dr.Ssaka Mustafa and Dr.Nabukeera Aisha Masimbi','images/group-photo-2.jpg'),(4,'2023-01-01 14:03:00','2023-01-01 14:03:00','The 1st guild president meeting with Islamic University In Uganda Alumni Association','<p>The Islamic university in Uganda alumni association(IUIUAA) executives arranged for a meeting with the alumni guild presidents, which purpose was basically to mobilize the former guild presidents of the mighty university to be one unit and also inform them about the upcoming alumni dinner event due to take place on 12th/02/2022 at spekes Resort Munyonyo.</p><p>The meeting was a successful one with good participation and important issues were raised by the Excellences which was discussed and we hope will lead to the success of the dinner, the major concern of the dinner was mobilization, calling upon the guild presidents to mobilize others both their cohorts and alumni’s under their term of office.</p><p>Both the IUIUAA chairman and the IUIU AA dinner chairman gave brief communications about the dinner which gave a full package of the dinner thus the purpose, objectives and theme of the dinner.</p>',1,2,0,'The Islamic university in Uganda alumni association(IUIUAA) executives arranged for a meeting with the alumni guild presidents, which purpose was basically to mobilize the former guild presidents of the mighty university to be one unit and also inform them about the upcoming alumni dinner event due to take place on 12th/02/2022 at spekes Resort Munyonyo.','images/alumni.jpg'),(5,'2023-01-01 20:10:36','2023-01-01 20:10:36','CREATING INVESTMENT OPPORTUNITIES THROUGH SOCIAL SYNERGIES','<p class=\"ql-align-justify\">Islamic University in Uganda (IUIU) will prepare a homecoming dinner, inviting all alumni to buy tickets to contribute to their alma mater. The event will take place at the Islamic University in Uganda Females’ Campus (IUIUFC) from 2:00 pm-9:00 pm. <strong>The dinner is one of the events organized by the </strong>alumni association other events included environmental activities 25-27<sup>th</sup> November 2022. The sports gala and team building exercises will take place on 4<sup>th</sup> February 2023, Health Caravans will be on each major event, and Daawa activities on 6<sup>th</sup> February 2023.</p><p class=\"ql-align-justify\">Alumni Homecoming Dinner is aimed at bringing a strong IUIU community to come together not only to reflect on the journey of IUIU but also to reconnect and celebrate the university’s tremendous achievements spanning across different disciplines and above all to start an investment club and construct a girls’ hostel at Islamic University in Uganda Females’ Campus (IUIUFC) Kabojja.</p><p class=\"ql-align-justify\">The event will be organized under the theme “<strong>CREATING INVESTMENT OPPORTUNITIES THROUGH SOCIAL SYNERGIES”</strong>. With over 30,000 graduates educated since its inception in 1988, IUIU has one of the largest and most resourceful Alumni in Uganda and the world over.</p><p class=\"ql-align-justify\">The event will host students, stakeholders, former students leaders, alumni, top university management, the university community, and invited guests. Participation is by the purchase of tickets ranging from 100,000/- standard, 200,000/- silver, 500,000/- Gold, 1,000,000/- Table, and 2,000,000/-Vip Table, for students with the proceeds going towards Rebuilding IUIU’s Infrastructures and students’ scholarship fund to help financially disadvantaged students towards payment of tuition fees.</p><p class=\"ql-align-justify\">The homecoming dinner is an opportunity for the alumni to reflect and think of how they could be part of IUIU’s journey for the next 30 years. It will be a moment to recognize, laud, and celebrate the contributions of those who were and continue to be instrumental in the university\'s success.</p><p class=\"ql-align-justify\">IUIU Alumni association and IUIU Regroup 2000, invite you to attend the homecoming dinner as we continue to move together and with IUIU as they continue celebrating #IUIU@34.</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">Author </p><p>Nabukeera Madinah Sebyala (PhD)</p><p>Director Islamic University in Uganda Females Campus Kabojja</p><p>Senior lecturer -Department of Public administration </p><p>Faculty of management studies.</p><p class=\"ql-align-justify\">E-Mail: <a href=\"mailto:nabmaidah@gmai.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(5, 99, 193);\">nabmaidah@gmail.com</a></p><p class=\"ql-align-justify\">Mob. +256776360170/ +256757720500</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">&nbsp;</p><p><br></p>',1,2,0,'Alumni Homecoming Dinner is aimed at bringing a strong IUIU community to come together not only to reflect on the journey of IUIU but also to reconnect and celebrate the university’s tremendous achievements spanning across different disciplines and above all to start an investment club and construct a girls’ hostel at Islamic University in Uganda Females’ Campus (IUIUFC) Kabojja.','images/FlGNcXaWQAEo2LT.jpg');
